(187, 'Mradi wa Kukabiliana na Mabadiliko ya Tabianchi na Usimamizi wa Mazingira', 'MBN', 'ZPC/Environmental/0007/2022', '1', 'Year', '2022-07-01', '2023-07-01', 'Project', 'IMPLEMENTATION', ' Mradi umeanzishwa kwa lengo la kuweza kuhimili mabadiliko ya tabianchi\r\nkatika ukanda wa pwani, kuyafanyia tathmini maeneo yaliyo hatarini kutokana\r\nna mabadiliko ya tabianchi, pamoja na kushajihisha uhifadhi wa mazingira\r\nkwa maendeleo endelevu ili kurejesha uoto wa kijani', 'ZADEP,Agenda 2063 (International),', 0, b'1', 'Appending', 24, 1, NULL, NULL, 13, 'Phase1', 'Government', 'National', NULL),
(188, 'Uimarishaji wa Jamii na usimamizi endelevu wa Ikolojia na shughuli za kujipatia kipato kwa wavuvi wadogo katika eneo la Mkondo wa Pemba (PECCA)', 'PECCA', 'ZPC/Environmental/0008/2022', '1', 'Year', '2022-07-01', '2023-07-01', 'Project', 'IMPLEMENTATION', ' Mradi una lengo la kupunguza shindikizo la rasilimali bahari kwa kuanzisha mfumo shirikishi na usimamizi wa bahari na kuanzasha vyanzo mbadala vya kujipatia kipato.', 'ZADEP,Agenda 2063 (International),', 0, b'1', 'Appending', 24, 1, NULL, NULL, 13, 'Phase1', 'Government', 'National', NULL),
(189, 'Mpango wa Kunusuru Kaya Masikini Awamu ya Tatu (TASAF III) Kipindi cha Pili', 'TASAF III', 'ZPC/Economic/0045/2022', '4', 'Year', '2021-07-01', '2025-07-01', 'Program', 'IMPLEMENTATION', ' Programu hii ni ya Kitaifa ambayo inatekelezwa baina ya Tanzania Bara\r\nna Zanzibar inagharimu jumla ya TZS 112.2 bilioni. Programu imeanza\r\nutekelezaji kwa awamu ya tatu mwaka 2020/21 na inatarajiwa kumalizika\r\nifikapo mwaka 2024/25, ina lengo la kuziwezesha kaya masikini zaidi\r\nkuongeza kipato, fursa na uwezo wa kugharamia mahitaji muhimu ya\r\nkibinadamu hasa chakula, afya na elimu. Programu inakusudia kutekeleza\r\nmiradi iliyoibuliwa na wananchi katika nyanja mbali mbali za elimu, afya,\r\nmaji safi na ajira za muda kwa lengo la kuwawezesha wananchi ili waweze\r\nkujikwamua na umasikini.', 'ZADEP,Agenda 2063 (International),Annual Development Plan,Sustainable Development Goals,', 0, b'1', 'Appending', 24, 1, NULL, NULL, 6, 'Phase2', 'SMZ & Donor', 'National', NULL),
