(199, 'Mradi wa matengenezo ya nyumba za maendeleo', '', 'ZPC//0001/2022', '1', 'Year', '2022-07-01', '2023-07-01', 'Project', 'IDENTIFICATION', ' Mradi huu una lengo la kuwapatia wananchi makaazi bora mijini na vijijini\r\nna utahusisha marekebisho ya miundombinu mbali mbali katika nyumba za\r\nmaendeleo ikiwemo miundombinu ya maji safi na maji taka, miundombinu\r\nya umeme, uwekaji wa madirisha na milango sambamba na ujenzi wa\r\nmaegesho ya magari katika maeneo tofuati ya nyumba hizo.', 'ZADEP,Agenda 2063 (International),Sustainable Development Goals,', 0, b'1', 'Appending', 24, 1, NULL, NULL, 22, 'Phase1', 'Government', 'National', NULL),
