(209, 'Mradi wa Kuifanyia Mabadiliko Sekta ya Nishati ', 'ZESTA', 'ZPC/Energy & Electricity/0009/2022', '6', 'Year', '2021-12-01', '2027-12-01', 'Project', 'IDENTIFICATION', ' Mradi wa Kuifanyia Mabadiliko Sekta ya Nishati (ZESTA) unatarajiwa\r\nkutekelezwa kwa miaka sita (2022-2027) na unakadiriwa kutumia jumla\r\nya TZS 372.48 bilioni kwa lengo la kuimarisha utekelezaji katika sekta ya\r\nnishati kwa kuimarisha miundombinu ya umeme na kuzijengea uwezo taasisi\r\nzinazoshughulikia masuala ya nishati. Mradi unatekelezwa kwa mashirikiano\r\nbaina ya Serikali ya Mapinduzi ya Zanzibar na Mshirika wa Maendeleo ambae ', 'ZADEP,', 0, b'1', 'Appending', 24, 1, NULL, NULL, 15, 'Phase1', 'SMZ & Donor', 'National', NULL),
(210, 'Programu ya Ujenzi wa Barabara kuu', 'Null', 'ZPC/Transport/0036/2022', '3', 'Year', '2022-07-01', '2025-06-29', 'Program', 'IDENTIFICATION', ' Programu hii ina lengo la kujenga barabara kwa kiwango cha lami, ujenzi\r\nwa mitaro pamoja na uwekaji wa taa na alama za barabarani kwa barabara\r\nkuu za Unguja na Pemba. Ukamilikaji wa barabara hizi utasaidia kuhuisha\r\nuchumi na uwekezaji kwa vile barabara hizi ni kiunganishi cha miji na maeneo\r\nmengine ya kiuchumi ikiwemo viwanja vya ndege na bandari. Programu hii\r\ninatarajiwa kuanza utekelezaji wake mwaka wa fedha 2022/23, na itahusisha\r\nujenzi wa barabara kuu mbalimbali ikiwemo barabara mpya na zinazoendelea,\r\ninatekelezwa kwa mashirikiano baina ya Serikali ya Mapinduzi ya Zanzibar\r\nna Washirika wa Maendeleo', '', 0, b'1', 'Appending', 30, 1, NULL, NULL, 4, 'Phase1', 'SMZ & Donor', 'National', NULL),
(211, 'Programu ya Kuendeleza Viwanja vya Michezo', 'PKVM', 'ZPC/Sport/0003/2022', '5', 'Year', '2021-07-01', '2026-07-01', 'Program', 'IMPLEMENTATION', ' Dhumuni la programu ni kukuza na kuendeleza Michezo Zanzibar na kuifanya\r\nsekta ya michezo kuweza kuimarika zaidi.', 'ZADEP,Agenda 2063 (International),Annual Development Plan,Sustainable Development Goals,', 0, b'1', 'Appending', 21, 4, NULL, NULL, 11, 'Phase2', 'Government', 'National', NULL),
(213, 'Programu ya Kuendeleza Sekta ya Kilimo na Uvuvi', 'IFAD', 'ZPC/Fishering/0007/2022', '6', 'Year', '2021-07-01', '2027-07-01', 'Program', 'IMPLEMENTATION', ' Programu ya Kuendeleza Sekta ya Kilimo na Uvuvi imeanza mwaka 2021/22 \r\nni ya miaka mitano (2021-2026) ambayo inatekelezwa kwa mashirikiano \r\nbaina ya Tanzania Bara na Zanzibar. Lengo ni kuongeza tija endelevu, \r\nuthabiti, faida na biashara ya mbegu za mazao, uvuvi na ufugaji wa samaki, \r\nkwa kutilia mkazo uwezeshaji wa wanawake na ushiriki wa vijana. Programu \r\ninatekelezwa kwa fedha za Washirika wa Maendeleo pekee. Kwa mwaka \r\n2022/23, kiasi cha TZS 13.80 bilioni zinatarajiwa kutolewa.', 'ZADEP,Agenda 2063 (International),Annual Development Plan,Sustainable Development Goals,', 0, b'1', 'Appending', 24, 1, NULL, NULL, 9, 'Phase1', 'Development Partners', 'National', NULL),
